import React from 'react';
import Head from 'next/head';

const Home: React.FC = () => {
  return (
    <div>
      <Head>
        <title>Meu título</title>
      </Head>

      <main>
        <h1>Olá Mundo</h1>
      </main>

      <footer />
    </div>
  );
}

export default Home;
